  Card,
} from "@mantine/core";

const LatestProduct = ({ setBoxVisible, boxVisible, title }) => {
  return (
    <Accordion.Item value="latest -product">
      <Accordion.Control bg="indigo.2">
        <Center>
          <Text fw={700}>Latest Product/ Recently Added</Text>
        </Center>
      </Accordion.Control>
      <Accordion.Panel>

      </Accordion.Panel>
    </Accordion.Item>
  );
};

